import {makeAutoObservable} from "mobx";

class ToolState {
    tool = null

    constructor() {
        makeAutoObservable(this)
    }

    setTool(tool){
        this.tool = tool;
    }

    setFillColor(color) {
        this.color = color
    }

    setFillColor(color) {
        this.color = color
    }

    setFillColor(color) {
        this.color = color
    }
}

export default new ToolState()
